        "    target_size = (80, 120),\n",
        "    batch_size  = 32,\n",
        "    class_mode  = 'categorical',\n",
        "    shuffle     = True\n",
        ")\n",
        "\n",
        "validation_generator = test_datagen.flow_from_directory(\n",
        "    validation_dir,\n",
        "    target_size = (80, 120),\n",
        "    batch_size  = 32,\n",
        "    class_mode  = 'categorical',\n",
        "    shuffle     = True\n",
